import { Container, Logo, Typography } from "@toptal/picasso";

import * as S from "./styles";

const Nav = () => {
  return (
    <Container flex padded={0.5} justifyContent="center" style={S.navContainer}>
      <Logo variant="white" />
      <Typography color="inherit">Top heroes</Typography>
    </Container>
  );
};

export default Nav;
